import React from "react";
import "./HomePage.css";

const HomePage = () => {
  return (
    <div className="homepage">
      <div className="hero-section hero1">
        <h2>60% OFF on Men's Clothing</h2>
        <p>Limited Time Offer</p>
        <button>Shop Now</button>
      </div>

      <div className="hero-section hero2">
        <h2>Flat 50% OFF on Women's Fashion</h2>
        <p>Trendy Styles Just for You</p>
        <button>Shop Now</button>
      </div>

      <div className="hero-section hero3">
        <h2>Kids Collection - Up to 40% OFF</h2>
        <p>Comfort & Style for Your Little Ones</p>
        <button>Shop Now</button>
      </div>

      <div className="hero-section hero4">
        <h2>Electronics Sale - Up to 70% OFF</h2>
        <p>Latest Gadgets at Best Prices</p>
        <button>Shop Now</button>
      </div>
    </div>
  );
};

export default HomePage;
